  validate = () => {
    debugger;
    var valerrlist;
    if (!this.state.temporary_block) {
      valerrlist = ["mobnumber"];
    } else {
      valerrlist = ["OTPNumber"];
    }

    const error = {};
    let isValidate = true;
    valerrlist.map((val) => {
      if (!this.state[val]) {
        error[val] = true;
        isValidate = false;
        if (this.state[val] === 0) {
          error[val] = false;
          isValidate = true;
        }
      } else {
        error[val] = false;
      }
      return error;
    });
    this.setState({ error: { ...error } });
    return isValidate;
